<script>

    function scrollToTopAbout() {
        $(document).ready(function(){

            //---------- Scroll Position ----------
            const yPosition =
                Math.max(window.pageYOffset,
                    document.documentElement.scrollTop,
                    document.body.scrollTop);
            console.log(yPosition);
            //-------------------------------------


            //---------- cross-fade background ----------
            if(yPosition < 50 ){
                $('.not-top').removeClass('top');
                console.log('test1')
            }

            if(yPosition > 50 ){
                console.log('start animation');
                $('.not-top').addClass('top');

            }
            //-------------------------------------


            //---------- cross-fade Welcome ----------
            if(yPosition > 50){
                $('.title').addClass('top');
                $('.subTitle').addClass('subTitleSlideRight');
                $('.tim').addClass('fadeInTim');
                $('.tim-bio').addClass('fadeInTimBio');


            }
            if(yPosition < 50){
                $('.title').removeClass('top').addClass('not-top');
                $('.subTitle').removeClass('subTitleSlideRight');
                $('.tim').removeClass('fadeInTim');
                $('.tim-bio').removeClass('fadeInTimBio');
            }
            //-------------------------------------


        })
    }
</script>
